import { Box, Center, Stack } from "@mantine/core";
import React from "react";

const ResponsivePhone = () => {
  return (
    <Stack>
      <Center>
        {/* <Box style={{ border: "1px solid #1b1c1b", borderRadius: "5px 5px 5px 5px" }}>Mobile</Box> */}

        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "100vh",
          }}
        >
          <Box
            style={{
              border: "1px solid #1b1c1b",
              borderRadius: "5px",
              padding: "16px",
              backgroundColor: "#ffffff",
              boxShadow: "0px 0px 10px rgba(0, 0, 0, 0.2)",
            }}
            shadow="xs"
            radius="sm"
            padding="lg"
          >
            Mobile
          </Box>
        </div>
      </Center>
    </Stack>
  );
};

export default ResponsivePhone;
